import React from 'react';
import Home from './pages/Home';
import Random from './pages/Random';

import './App.css';
import {BrowserRouter, Link, Route, Routes} from "react-router-dom";

const App = () =>

            <BrowserRouter>
                <Routes>
                <Route path="/" element={<Home />} />                 
                <Route path="/random" element={<Random />} />                 


                </Routes>
            </BrowserRouter>

;

export default App;
